Esse sérum que contém água vulcânica Vichy, ácido hialurônico, cafeína e dermochlorella tem como promessa:

- Proteger e fortalecer a área dos olhos contra os agentes externos como poluição, mudança de clima, etc. 

- Suavizar bolsas e olheiras

- Hidratar por 24h

- Suavizar linhas finas

O que eu achei:

O sérum tem um aspecto de gel e é imediatamente absorvido pela pele, mas não deixa a sensação de área mais hidratada. Eu tenho essa região naturalmente seca e já usei produtos que fizessem mais por ela. Quanto a diminuição de olheiras e bolsas, tambem não noto diferença. 

Estou usando esse serum por aproximadamente 3 meses. No início, aplicava somente ele para poder avaliar o produto melhor. Não muitas horas depois eu me sentia com os olhos com aspecto envelhecido, a maquiagem craquelava toda. Não consegui ficar por muito tempo sem combinar o uso dele com um hidratante mais espesso. Combinei com (Perricone MD brightening eye cream). 

Ao usá-lo com um hidratante (para olhos) mais espesso, minha pele voltou ao normal. Gosto da sensação de refrescância no momento da aplicação que esse serum me dá. Penso eu que o serum esta me fornecendo ácido hialurônico para as camadas mais profundas da pele onde o hidratante não consegue alcançar.  No entanto, não considero esse produto indispensável.

⭐️Nota 3.0 de 5

Não cumpre com a maior parte das promessas! 🤷🏻‍♀️

